SIALKOT, Jan 04 (APP)::Special Assistant to Prime Minister on Information and Broadcasting Dr Firdous Ashiq Awan will address a public meeting in village Teijar-Daallowali near Sialkot here on Sunday, Jan 5, 2020.
She will also inaugurate several development projects there in constituency NA-72, Sialkot-I, as well.
